  CONSTRAINT `students_student_chk_1` CHECK ((`semester` >= 0)),
  CONSTRAINT `students_student_chk_2` CHECK ((`cet_rank` >= 0)),
  CONSTRAINT `students_student_chk_3` CHECK ((`admission_year` >= 0))
) ENGINE=InnoDB AUTO_INCREMENT=739 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
